exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`http://www.gzmeal.com/${bid}.shtml`,{cleaner:html=>cleanCatalogWrapper(html,/<ul>\s*<div[^>]*>\s*<h3>/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"}})};